import { Form, Field, Formik } from "formik";
import CouponsCustomerActionbar from './CouponsCustomerActionbar/CouponsCustomerActionbar'
import './coupons.css'
import testImage from './../../../../../../assests/The Coupon Project Logo.png'

export default function Coupons() {


    return (
        <div className="Coupons">
            <Formik initialValues={{ checked: [] }}>
                {({ values }) => (<>
                    <Form>
                        <div className='Coupons-table'>
                            <div className="row">
                                <th></th>
                                <div className="col-md-1" id='Coupon-table-header' width='80px'></div>
                                <div className="col-md-1" id='Coupon-table-header' width='80px'>Stock</div>
                                <div className="col-md-1" id='Coupon-table-header' width='300px'>Title</div>
                                <div className="col-md-1" id='Coupon-table-header' width='600px'>Description</div>
                                <div className="col-md-1" id='Coupon-table-header' width='80px'>Price</div>
                                <div className="col-md-1" id='Coupon-table-header' width='120px'>Category</div>
                                <div className="col-md-1" id='Coupon-table-header' width='120px'>Release Date</div>
                                <div className="col-md-1" id='Coupon-table-header' width='120px'>Expiration Date</div>
                            </div>
                            <div className="row">
                                <label>
                                    <div className="col-md-1"><Field type="checkbox" name="checked" value="1" id='1' className='Coupon-field-checkbox' /></div>
                                    <div className="col-md-1">id="Coupons-table-img-label"><img className="Coupons-table-img" src={testImage} alt='img' /></div>
                                    <div className="col-md-1">100</div>
                                    <div className="col-md-1">Hermon Mountain Ski Day</div>
                                    <div className="col-md-1">A Full Day Entry With Equipment ####################</div>
                                    <div className="col-md-1">150$</div>
                                    <div className="col-md-1">ATTRACTION</div>
                                    <div className="col-md-1">2019-01-20</div>
                                    <div className="col-md-1">2024-01-20</div>
                                </label>
                            </div>
                            {/* <div className="row">
                                <td><Field type="checkbox" name="checked" value="2" id='2' className='Coupon-field-checkbox' /></td>
                                <td><label htmlFor="2" className="Coupons-table-img-label"><img className="Coupons-table-img" src={testImage} alt='img' /></label></td>
                                <td><label htmlFor="2" className="Coupons-table-text-label">99999</label></td>
                                <td><label htmlFor="2" className="Coupons-table-text-label">Falafel Haderch</label></td>
                                <td><label htmlFor="2" className="Coupons-table-text-label">+1 Free Falafel Ball</label></td>
                                <td><label htmlFor="2" className="Coupons-table-text-label">0.01$</label></td>
                                <td><label htmlFor="2" className="Coupons-table-text-label">FOOD</label></td>
                                <td><label htmlFor="2" className="Coupons-table-text-label">2020-03-23</label></td>
                                <td><label htmlFor="2" className="Coupons-table-text-label">2050-03-23</label></td>
                            </div>
                            <div className="row">
                                <td><Field type="checkbox" name="checked" value="3" id='3' className='Coupon-field-checkbox' /></td>
                                <td><label htmlFor="3" className="Coupons-table-img-label"><img className="Coupons-table-img" src={testImage} alt='img' /></label></td>
                                <td><label htmlFor="3" className="Coupons-table-text-label">100</label></td>
                                <td><label htmlFor="3" className="Coupons-table-text-label">Cake</label></td>
                                <td><label htmlFor="3" className="Coupons-table-text-label">1+1</label></td>
                                <td><label htmlFor="3" className="Coupons-table-text-label">29.99$</label></td>
                                <td><label htmlFor="3" className="Coupons-table-text-label">FOOD</label></td>
                                <td><label htmlFor="3" className="Coupons-table-text-label">2020-01-01</label></td>
                                <td><label htmlFor="3" className="Coupons-table-text-label">2023-01-01</label></td>
                            </div> */}
                        </div>
                    </Form>
                    <CouponsCustomerActionbar values={values} />
                </>)}
            </Formik>
        </div>)


    // return (
    //     <div className="Coupons">
